AuditLogServiceOutput:
  type: string
  nullable: true
  enum:
  - CSV
  - TSV
  - ZIPPED_CSV
  - ZIPPED_TSV
  - UNKNOWN
  title: AuditLogServiceOutput
  description: |
    <div lang="ja">AuditLogServiceOutputは、操作履歴取得ジョブのファイル形式を指定します。<br>
    このフィールドは、省略可能となります。その際、デフォルト値はCSVとなります。</div>
    <div lang="en">AuditLogServiceOutput specifies the file format of acruiqred operation history data.<br>
    This field is optional. The default value will be CSV.</div>
    <dl class=term>
      <dt class="term__item">ZIPPED_CSV</dt>
      <dd class="term__desc"><span lang="ja">ZIP圧縮されたCSV形式です。</span><span lang="en">in zipped CSV format</span></dd>
      <dt class="term__item">ZIPPED_TSV</dt>
      <dd class="term__desc"><span lang="ja">ZIP圧縮されたTSV形式です。</span><span lang="en">in zipped TSV format</span></dd>
      <dt class="term__item">CSV</dt>
      <dd class="term__desc"><span lang="ja">CSV形式です。</span><span lang="en">in CSV format</span></dd>
      <dt class="term__item">TSV</dt>
      <dd class="term__desc"><span lang="ja">TSV形式です。</span><span lang="en">in TSV format</span></dd>
      <dt class="term__item">UNKNOWN</dt>
      <dd class="term__desc"><span lang="ja">未知の値です。</span><span lang="en">Unknown Value</span></dd>
    </dl>
